import React from 'react';

class Activity extends React.Component{
    constructor(props){
       super(props);

    }

    render(){
        return <>
        <div className='container columns activity'>
              <div className='column has-background-info-light  is-2'>
               <h2>Music</h2>
              </div>
              <div className='level'>
                  <span className='level-item'>1</span>
                  <span className='level-item'>2</span>
                  <span className='level-item'>3</span>
                  <span className='level-item'>4</span>
                  <span className='level-item'>5</span>
                  <span className='level-item'>6</span>
                  <span className='level-item'>7</span>


              </div>
        </div>
        </>
    }
}


export default Activity;
